import React from "react";
import { Row, Col } from "antd";

import CharacterCard from "../../../../components/common/CharacterCard";

const CharacterSearch = () => {
  return (
    <div className="search-page">
      <h2 className="side-heading">Search results for: history</h2>
      <Row gutter={[16, 16]}>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
        <Col xxl={4} xl={6} lg={8}>
          <CharacterCard />
        </Col>
      </Row>
    </div>
  );
};

export default CharacterSearch;
